import React from 'react'
import {
  Link
} from "react-router-dom";
import './style.css'

function Menu() {
  return (
    <div>
      <h1>TileButton</h1>
      <nav >
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/addbutton">AddButton</Link></li>
          <li><Link to="/todolist">TodoList</Link></li>
        </ul>
      </nav>
      <hr />
    </div>
  );
}

export default Menu
